import React from 'react';
import { AppBar, Box, Toolbar, Container, Typography } from "@mui/material";

export default function Navbar() {

  return (
    <Box>
      <AppBar position='static' color='transparent'>
        <Container>
          <Toolbar>
            <Typography>
            Mande App
            </Typography>
          </Toolbar>
        </Container>
      </AppBar>
    </Box>
  )
  
}
